window.bookSummaryJSON = "<p>WELCOME TO THE FOREST OF GOOD AND EVIL.</p> <p>A DREAM COME TRUE.... AND A LIVING NIGHTMARE.</p> <p>Far, far away, in the realm of Enchantia, creatures of legend still exist, magic is the norm and fairy tales are real. Except, fairy tales aren’t based on myths and legends of the past - they are prophecies of the future.</p> <p>Raised in the mortal realm, Everly Morrow has no idea she’s a real-life fairy-tale princess - until she manifests an ability to commune with mirrors.</p> <p>Look. See.... What will one peek hurt?</p> <p>Soon, a horrifying truth is revealed. She is fated to be Snow White’s greatest enemy, the Evil Queen.</p> <p>With powers beyond her imagination or control, Everly returns to the land of her birth. There, she meets Roth Charmaine, the supposed Prince Charming. Their attraction is undeniable, but their relationship is doomed. As the prophecy unfolds, Everly faces one betrayal after another, and giving in to her dark side proves more tempting every day. Can she resist, or will she become the queen - and villain - she was born to be?</p> <p>The battle between good and evil is on. </p>"; 
